var topic = "<!DOCTYPE html>\r\n\n<!-- saved from url=(0024)http://docs.autodesk.com -->\r\n<html>\n   <head>\n      <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n      <meta name=\"product\" content=\"ACD\">\n      <meta name=\"release\" content=\"2019\">\n      <meta name=\"book\" content=\"Installation\">\n      <meta name=\"created\" content=\"2018-01-15\">\n      <meta name=\"topicid\" content=\"GUID-BCD5BED1-5014-49D1-ADDE-2271B4BA49EB\">\n      <meta name=\"description\" content=\"Install products, receive product notifications, download updates and access learning tools through the Autodesk desktop app.\">\n      <meta name=\"topic-type\" content=\"concept\">\n      <meta name=\"audience\" content=\"administrator\">\n      <meta name=\"experiencelevel\" content=\"general\">\n      <meta name=\"topic-subtype\" content=\"installing\">\n      <title>About the Autodesk Desktop App</title><script language=\"javascript\">var index = \'index.html\';</script></head>\n   <body height=\"100%\">\n      <div class=\"body_content\" id=\"body-content\" dir=\"ltr\"><a name=\"GUID-BCD5BED1-5014-49D1-ADDE-2271B4BA49EB\"></a><div class=\"head\">\n            <h1>About the Autodesk Desktop App</h1>\n         </div>\n         <p class=\"blurb\"> Install products, receive product notifications, download updates and access learning\n            tools through the Autodesk desktop app. \n            \n         </p>\n         <p><a name=\"GUID-327101A0-69AD-4003-95E4-C503802B3397\"></a>The Autodesk desktop app is installed by default with all Windows-based Autodesk products.\n            \n            	 \n         </p>\n         <p><a name=\"GUID-9F8A8A43-FF9F-4C44-8E83-870AAE4C8521\"></a>When installed, the Autodesk desktop app notifies each user when product updates are\n            available. Users can download and install the updates directly from the Autodesk desktop\n            app. If you decide not to install the Autodesk desktop app, you can control product\n            updates from your Autodesk Account. If you need to reinstall the Autodesk desktop\n            app, you can do so \n            		<a href=\"https://www.autodesk.com/ada-akn-install2\">from this page</a>. \n            	 \n         </p>\n         <div class=\"footer-block\"><a href=\"..\" class=\"comments-anchor\" target=\"_blank\"><span class=\"comments-link\">Please send us your comment about this page</span></a></div><br><p class=\"footer-license-block\"><a rel=\"license\" href=\"http://creativecommons.org/licenses/by-nc-sa/3.0/\" target=\"_blank\"><img alt=\"Creative Commons License\" style=\"border-width: 0;\" src=\"../images/ccLink.png\"></a>&nbsp;<em>Except where otherwise noted, this work is licensed under a <a rel=\"license\" href=\"http://creativecommons.org/licenses/by-nc-sa/3.0/\" target=\"_blank\">Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License</a>. Please see the <a href=\"http://autodesk.com/creativecommons\" target=\"_blank\">Autodesk Creative Commons FAQ</a> for more information.</em></p><br></div>\n   </body>\n</html>";
